import { FooterComponent } from './components/footer/footer.component';
import { FriendsComponent } from './components/friends/friends.component';



@NgModule({
  declarations: [
    PostCardComponent,
    FooterComponent,
    FriendsComponent
  ],
  imports: [
    CommonModule
  ],
  exports: [
    PostCardComponent,
    FooterComponent
  ]
